Сокращение объема подачи воды

В связи с повреждением водоводов №9 и №14 в районе Северного водоузла по состоянию на 14:00 22 февраля сокращена подача холодной воды в следующие районы города:

Киевский район – на 30%;

Куйбышевский район – на 50%;

Кировский район – на 50%;

Петровский район – на 30%;

Ленинский район – на 30%.

На данный момент специалистами выполняется ряд мероприятий по водораспределению для нормализации стабильного водоснабжения. В полном объеме водоснабжение данных районов восстановится после окончания ремонтных работ на водоводах.

