В результате артиллерийского обстрела поврежден трансформатор, расположенный в серой зоне, западнее населенного пункта Васильевка Ясиноватского района. Вследствие этого произошла остановка 1-го подъема Южно-Донбасского водовода, что привело к прекращению водоснабжения в пгт Еленовка. 

С 10:00 22 февраля до окончания аварийно-восстановительных работ жителям поселка ежедневно будет осуществляться подвоз питьевой воды силами ГУП ДНР "Вода Донбасса" по следующим адресам:

- ул. Московская;
- железнодорожный вокзал;
- ул. 1 Мая;
- микрорайон Новый;
- пос. Молодежный.

